import React from "react";

export default function CrudTableRow({ el, setDataToEdit, deleteData }) {
  return (
    <tr>
      <td>{el.id}</td>
      <td>{el.User}</td>
      <td>{el.CreateDate}</td>
      <td>{el.UpdateDate}</td>
      <td>{el.State}</td>

      <td>
        <button onClick={(() => setDataToEdit(el), "location.reload()")}>
          {" "}
          Editar
        </button>

        <button onClick={() => deleteData(el.id)}> Elimiar</button>
      </td>
    </tr>
  );
}
